import { Route, Routes } from "react-router-dom";
import Allusers from "../../pages/AllUsers";

export default function Routs() {
  return (
    <div>
      <Routes>
        <Route path="/allusers" element={<Allusers />} />
      </Routes>
    </div>
  );
}
